import React from 'react';
import { Link } from 'react-router-dom';
import './BusBooking.css'; // Style file for Glassmorphism effect

const BusBooking = () => {
  return (
    <div className="bus-booking-container">
      <div className="glassmorphism-effect">
        <div className="bus-image">
          <img src="bus-image.jpg" alt="Bus" />
        </div>
        <div className="bus-details">
          <h2>Bus Name or Route</h2>
          <p>Details about the bus like amenities, timings, etc.</p>
          <Link to="/Home" className="book-button">Book Now</Link>
        </div>
        <div className="animated-slogan">
          <p>Discover New Places</p>
          <p>Experience Comfort Travel</p>
          {/* You can add more slogans here */}
        </div>
      </div>
    </div>
  );
}

export default BusBooking;
